import React from "react";
import "./style.css";

class RadioButton extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            statuses: this.props.statuses
        };
    }


    render() {
        return (
            <React.Fragment>

                {this.state.statuses.map((item, i) => {
                    return (
                        <div className="radio">
                            <label>
                                <input type="radio" value="option2"/>
                                item
                            </label>
                        </div>
                    );
                })}

            </React.Fragment>
        );
    }
}

export default RadioButton;
